import React from "react";
import {Link} from "react-router-dom";

const productTerm=(props) => {
    return(
        <tr>
            <td scope={"col"}>{props.term.name}</td>
            <td scope={"col"}>{props.term.category}</td>
            <td scope={"col"}>{props.term.author.name}</td>
            <td scope={"col"}>{props.term.available}</td>
            <td scope={"col"}>
                <a title={"Delete"} className={"btn btn-danger"} onClick={()=>props.onDelete(props.ivana.id)}>Delete</a>
                <Link className={"btn btn-info ml-2"} onClick={()=>props.onEdit(props.ivana.id)} to={`/products/edit/${props.ivana.id}`}>Edit</Link>
            </td>
        </tr>
    );
}

export default productTerm;
